import * as S from './NavLink.style';

const NavLink = () => {
  return (
    <S.NavDropDonwMenu>
      <S.LinkList>
        <S.Link>Login</S.Link>
        <S.Link>SignUp</S.Link>
      </S.LinkList>
    </S.NavDropDonwMenu>
  );
};

export default NavLink;
